import React, { Component } from 'react';
// import logo from './logo.svg';
import Pokegame from './Pokegame';
import './App.css';

class App extends Component {
	render() {
		return (
			<div className="App">
				<Pokegame />
			</div>
		);
	}
}

export default App;
